import Rust from '../components/rust'
import { useState } from 'react'

const Index = () => {
  const [state, setState] = useState([])

  return (
    <div className="container">
      <input onChange={event => setState(event.target.value)} />
      <div>{state}</div>
      <Rust />
    </div>
  )
}

export default Index
